import styled from "styled-components";

export const DivInputUpload = styled.div`
  width: 50%;
  margin: 0 auto;
  margin-top: 50px;
  /* bg card */

  background: #ffffff;
  /* Border */

  border: 1px solid #e5e5e5;
  box-sizing: border-box;
  border-radius: 6px;
`;
